insert  into `ykx9st_azurapagebuilder_elements`(`id`,`pageID`,`name`,`type`,`hasChild`,`level`,`hasChildID`,`hasParentID`,`shortcode`,`object`,`content`,`attrs`,`ordering`,`elementOrder`,`published`,`trash`,`created`,`created_by`,`modified`,`modified_by`,`language`) values (1872,32,'Content','AzuraHtml',0,3,NULL,5,'','  ','<div style=\"text-align: justify;\" data-mce-style=\"text-align: justify;\"><h4>{lang en}</h4><h4><strong>Health Commodity Dashboard - OSPSANTE</strong></h4></div><p style=\"font-size: 15px; text-align: justify;\" data-mce-style=\"font-size: 15px; text-align: justify;\">The Pharmaceutical Management Information Dashboard is developed by the USAID funded <a href=\"http://siapsprogram.org/\" data-mce-href=\"http://siapsprogram.org/\">SIAPS Program</a> and implemented in Mali, Guinea, and South Sudan for better management of malaria, family planning, and maternal and child health commodities. The goal of the Dashboard is to capture, track, aggregate, and disseminate information about malaria, FP, and MCH commodities to support evidence based decision making in these countries. The Dashboard will assist countries stakeholders, donors including USAID, GFATM, WHO, UNFPA and other implementing partners in improving forecasting, supply planning and procurement to support the continuous availability of malaria, FP, and MCH related commodities. The Dashboard will also offer to partners a platform to easily share information on funding flows and stock out risks. The data available on this platform will be used to inform decision-making and assist identify solutions to mitigate risks in the short-, medium- and long-term.{/lang}</p><div style=\"text-align: justify;\" data-mce-style=\"text-align: justify;\">{lang fr}<h4><strong>Tableau de bord des produits de santé - OSPSANTE</strong></h4></div><p style=\"font-size: 15px; text-align: justify;\" data-mce-style=\"font-size: 15px; text-align: justify;\">L\'information Management Dashboard pharmaceutique est développé par l\'USAID financé <a href=\"http://siapsprogram.org/\" data-mce-href=\"http://siapsprogram.org/\">SIAPS Program</a> et mis en œuvre au Mali, en Guinée et au Soudan du Sud pour une meilleure gestion du paludisme, la planification familiale, et les produits de santé maternelle et infantile. Le but du tableau de bord est de capturer, piste, globale, et diffuser des informations sur le paludisme, les produits PF et de SMI pour appuyer la prise de ces pays preuves décision fondée. Le tableau de bord sera d\'aider les pays les parties prenantes, y compris les bailleurs de fonds de l\'USAID, le Fonds mondial, l\'OMS, le FNUAP et d\'autres partenaires d\'exécution dans l\'amélioration de la prévision, la planification de l\'offre et de passation des marchés pour soutenir la disponibilité continue de paludisme, les produits de PF, et MCH liées. Le tableau de bord sera également offrir aux partenaires une plateforme pour partager facilement des informations sur les flux de financement et de stocker des risques. Les données disponibles sur cette plate-forme seront utilisées pour éclairer la prise de décision et d\'aider à identifier des solutions pour atténuer les risques dans le court, moyen et long terme. {/lang}</p>','{\"margin_top\":\"\",\"margin_right\":\"\",\"margin_bottom\":\"\",\"margin_left\":\"\",\"border_top_width\":\"\",\"border_right_width\":\"\",\"border_bottom_width\":\"\",\"border_left_width\":\"\",\"padding_top\":\"\",\"padding_right\":\"\",\"padding_bottom\":\"\",\"padding_left\":\"\",\"border_color\":\"\",\"border_style\":\"\",\"background_color\":\"\",\"background_image\":\"\",\"background_repeat\":\"\",\"background_attachment\":\"\",\"background_size\":\"\",\"additional_style\":\"\",\"animation\":\"0\",\"trigger\":\"animate\",\"animationtype\":\"\",\"animationdelay\":\"\"}',74,9,1,0,'2014-09-04 02:24:00',327,'2015-05-06 08:44:25',327,'*');
