insert  into `ykx9st_ucm_history`(`version_id`,`ucm_item_id`,`ucm_type_id`,`version_note`,`save_date`,`editor_user_id`,`character_count`,`sha1_hash`,`version_data`,`keep_forever`) values (4,3,1,'','2014-07-30 10:17:26',327,5410,'069d53db15c954a830eecbeba40ca7c589aa222f','{\"id\":3,\"asset_id\":82,\"title\":\"Getting Started\",\"alias\":\"getting-started\",\"introtext\":\"It\'s easy to get started creating your website. Knowing some of the basics will help.<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">What is a Content Management System?<\\/h3>\\r\\nA content management system is software that allows you to create and manage webpages easily by separating the creation of your content from the mechanics required to present it on the web.<br \\/><br \\/>In this site, the content is stored in a\\u00a0<em>database<\\/em>. The look and feel are created by a\\u00a0<em>template<\\/em>. Joomla! brings together the template and your content to create web pages.<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">Logging in<\\/h3>\\r\\nTo login to your site use the user name and password that were created as part of the installation process. Once logged-in you will be able to create and edit articles and modify some settings.<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">Creating an article<\\/h3>\\r\\nOnce you are logged-in, a new menu will be visible. To create a new article, click on the \\\"Submit Article\\\" link on that menu.<br \\/><br \\/>The new article interface gives you a lot of options, but all you need to do is add a title and put something in the content area. To make it easy to find, set the state to published.<br \\/><br \\/>You can edit an existing article by clicking on the edit icon (this only displays to users who have the right to edit).<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">Template, site settings, and modules<\\/h3>\\r\\nThe look and feel of your site is controlled by a template. You can change the site name, background colour, highlights colour and more by editing the template settings. Click the \\\"Template Settings\\\" in the user menu.\\u00a0<br \\/><br \\/>The boxes around the main content of the site are called modules. \\u00a0You can modify modules on the current page by moving your cursor to the module and clicking the edit link. Always be sure to save and close any module you edit.<br \\/><br \\/>You can change some site settings such as the site name and description by clicking on the \\\"Site Settings\\\" link.<br \\/><br \\/>More advanced options for templates, site settings, modules, and more are available in the site administrator.<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">Site and Administrator<\\/h3>\\r\\nYour site actually has two separate sites. The site (also called the front end) is what visitors to your site will see. The administrator (also called the back end) is only used by people managing your site. You can access the administrator by clicking the \\\"Site Administrator\\\" link on the \\\"User Menu\\\" menu (visible once you login) or by adding \\/administrator to the end of your domain name. The same user name and password are used for both sites.<br \\/><br \\/>\\r\\n<h3 style=\\\"margin: 12px 0px; font-family: \'Open Sans\', sans-serif; line-height: 20px; color: #333333; font-size: 18px;\\\">Learn more<\\/h3>\\r\\nThere is much more to learn about how to use Joomla! to create the web site you envision. You can learn much more at the\\u00a0<a href=\\\"http:\\/\\/docs.joomla.org\\/\\\" target=\\\"_blank\\\" style=\\\"color: #0088cc; text-decoration: none;\\\">Joomla! documentation site<\\/a>\\u00a0and on the<a href=\\\"http:\\/\\/forum.joomla.org\\/\\\" target=\\\"_blank\\\" style=\\\"color: #0088cc; text-decoration: none;\\\">\\u00a0Joomla! forums<\\/a>.\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2014-07-30 10:17:26\",\"created_by\":\"327\",\"created_by_alias\":\"\",\"modified\":\"\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2014-07-30 10:17:26\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":null,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0);
